import React from 'react';

const welcome = {
	greeting: 'Hey',
	title: 'React',
};

const list =[
{
	title: 'React',
	url: 'https://reactjs.org/',
	author: 'Jordan Walke',
	num_comments: 3,
	points: 4,
	objectId: 0,
},
{
	title: 'Redux',
	url: 'https://redux.js.org/',
	author: 'Dan Abramov, Andrew Clark',
	num_comments: 2,
	points: 5,
	objectId: 1,
}
]

function App() {

  return(
    <div>
      <h1>My Hacker Stories</h1>

      <label htmlFor="search">Search: </label>
      <input id="search" type="text" /> 

      <hr />

      {list.map(item=>{
      	return <div>{item.title}</div>;
      })}
    </div>
  );
}

export default App;
